import React, { useState } from "react";

interface ProductCardProps {
  product: any;
}

const ProductCard: React.FC<ProductCardProps> = ({ product }) => {
  const [isExpanded, setIsExpanded] = useState(false);

  // 가격 랜덤 생성 (실제로는 API에서 받아올 데이터)
  const price = Math.floor(Math.random() * 50000) + 20000;
  const discount = Math.random() > 0.7 ? Math.floor(Math.random() * 30) + 10 : 0;
  const finalPrice = discount > 0 ? Math.floor(price * (1 - discount / 100)) : price;

  return (
    <div className="bg-white rounded-2xl shadow-lg hover:shadow-xl transition-all duration-300 transform hover:-translate-y-1 border border-gray-100 overflow-hidden group">
      {/* 내용 */}
      <div className="p-6">
        {/* 카테고리 */}
        <div className="flex gap-1 mb-3">
          {product.categories.slice(0, 2).map((category: string, idx: number) => (
            <span key={idx} className="text-xs bg-blue-100 text-blue-600 px-2 py-1 rounded-full">
              {category}
            </span>
          ))}
        </div>

        {/* 제목 */}
        <h2 className="text-xl font-bold text-gray-900 mb-3 line-clamp-2">
          {product.name}
        </h2>

        {/* 설명 */}
        <p className="text-sm text-gray-600 mb-4 line-clamp-3">
          {product.description}
        </p>

        {/* 위치 */}
        <div className="flex items-center gap-2 mb-4">
          <svg className="h-4 w-4 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
          </svg>
          <span className="text-sm text-gray-600">{product.locations.join(", ")}</span>
        </div>

        {/* 가격 */}
        <div className="flex items-center justify-between mb-4">
          <div className="flex items-center gap-2">
            {discount > 0 && (
              <span className="text-sm text-gray-400 line-through">
                ₩{price.toLocaleString()}
              </span>
            )}
            <span className="text-2xl font-bold text-blue-600">
              ₩{finalPrice.toLocaleString()}
            </span>
          </div>
          <span className="text-xs text-gray-500">1인당</span>
        </div>

        {/* 태그 */}
        <div className="flex flex-wrap gap-1 mb-4">
          {product.tags.slice(0, 3).map((tag: string, idx: number) => (
            <span key={idx} className="text-xs text-gray-500 bg-gray-100 px-2 py-1 rounded">
              #{tag}
            </span>
          ))}
        </div>

        {/* 드롭다운 버튼 */}
        <div className="border-t border-gray-100 pt-4">
          <button
            onClick={() => setIsExpanded(!isExpanded)}
            className="w-full flex items-center justify-between text-sm font-medium text-blue-600 hover:text-blue-700 transition-colors"
          >
            <span>예약 링크 보기</span>
            <svg 
              className={`h-4 w-4 transition-transform duration-200 ${isExpanded ? 'rotate-180' : ''}`} 
              fill="none" 
              viewBox="0 0 24 24" 
              stroke="currentColor"
            >
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
            </svg>
          </button>

          {/* 드롭다운 내용 */}
          {isExpanded && (
            <div className="mt-3 space-y-2">
              {product.externalUrls.map((url: string, idx: number) => (
                <a
                  key={idx}
                  href={url}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="block w-full text-left px-3 py-2 text-sm text-gray-700 bg-gray-50 rounded-lg hover:bg-gray-100 transition-colors"
                >
                  {url}
                </a>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default ProductCard;
